        <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
            <Card.Title>Nunc porttitor vel</Card.Title>
            <Card.Text>
                Nunc malesuada eget est fringilla dapibus.
            </Card.Text>
            <Button variant="primary">More</Button>
        </Card.Body>
    </Card>
    </>
}

export default newsCard;
